import './App.css';


function App() {
return (
<div>
<nav className="navbar">
<h2 className="logo">Roshan Website</h2>
<ul className="menu">
<li>Home</li>
<li>About</li>
<li>Contact</li>
</ul>
</nav>


<div className="content">
<h1>Welcome to Roshan Website</h1>
<p>This is a simple React + Django website.</p>
</div>
</div>
);
}


export default App;
